import React, { useEffect, useState } from "react";
import axios from "axios";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import L from "leaflet";
import tileLayer from "../util/tileLayer";

const center = [41.0053, 28.9770];
const colors = ["fe4848", "fe6c58", "fe9068", "feb478", "fed686"];
const labels = ["2-12.5", "12.6-16.8", "16.9-20.9", "21-25.9", "26-plus"];

function customMarkerIcon(color) {
  const svgTemplate = `
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 32 32" class="marker">
      <path fill-opacity=".25" d="M16 32s1.427-9.585 3.761-12.025c4.595-4.805 8.685-.99 8.685-.99s4.044 3.964-.526 8.743C25.514 30.245 16 32 16 32z"/>
      <path fill="#${color}" stroke="#fff" d="M15.938 32S6 17.938 6 11.938C6 .125 15.938 0 15.938 0S26 .125 26 11.875C26 18.062 15.938 32 15.938 32zM16 6a4 4 0 100 8 4 4 0 000-8z"/>
    </svg>`;

  return new L.DivIcon({
    className: "test",
    html: svgTemplate,
    iconSize: [40, 40],
    iconAnchor: [12, 24],
    popupAnchor: [7, -16],
  });
}

const MyMarkers = ({ data }) => {
  const [selectedPoint, setSelectedPoint] = useState(null);

  const handleMarkerClick = (point) => {
    setSelectedPoint(point);
  };

  return data.map((item, index) => (
    <Marker
      key={index}
      icon={customMarkerIcon(colors[index])}
      position={[parseFloat(item.city_latitude), parseFloat(item.city_longitude)]}
      eventHandlers={{
        click: () => handleMarkerClick(item),
      }}
    >
      {selectedPoint === item && (
       <Popup>
       <div className="popup-content">
         <div className="popup-header">
           <strong>{item.location_title}</strong> 
         </div>
         <div className="popup-body">
           <p><strong>Estimated Area:</strong> {item.estimated_area}</p>
           <p><strong>Monthly Rent:</strong> {item.monthly_rent}</p>
           <p><strong>Management Title:</strong> {item.management_title}</p>
           <p><strong>Operator Title:</strong> {item.operator_title}</p>
           <div className="location-details">
             <p><strong>Location Details:</strong></p>
             <ul>
               <li><strong>Country Title:</strong> {item.country_title}</li>
               <li><strong>City Title:</strong> {item.city_title}</li>
               <li><strong>Square Title:</strong> {item.square_title}</li>
             </ul>
           </div>
         </div>
       </div>
     </Popup>

      )}
    </Marker>
  ));
};

const Legend = ({ map }) => {
  useEffect(() => {
    if (!map) return;

    const legend = L.control({ position: "bottomright" });

    const rows = [];
    legend.onAdd = () => {
      const div = L.DomUtil.create("div", "legend");
      colors.map((color, index) => {
        return rows.push(`
            <div class="row">
              <i style="background: #${color}"></i>${labels[index]}
            </div>
          `);
      });
      div.innerHTML = rows.join("");
      return div;
    };

    legend.addTo(map);
  }, [map]);

  return null;
};

const MapWrapper = () => {
  const [map, setMap] = useState(null);
  const [points, setPoints] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get("http://localhost:8000/temps/results");
        console.log(response.results);
        setPoints(response.data);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, []);

  return (
    <MapContainer
      whenCreated={setMap}
      center={center}
      zoom={13}
      scrollWheelZoom={false}
    >
      <TileLayer {...tileLayer} />

      <MyMarkers data={points} />

      <Legend map={map} />
    </MapContainer>
  );
};

export default MapWrapper;
